import {Typography }  from '@mui/material';
function Mui() {
  return (
    <>
    <Typography
     variant='h4'
     sx={{color:'red'}} 
     component={'Home'}
     m={3}
    >
        we are learning MUI
    </Typography>
   
    {/*  */}
    </>
  )
}

export default Mui;
